INSERT INTO `fragments_data` VALUES (3,NULL,26,'{\"content\":{\"body\":\"<h1 style=\\\"text-align:center;\\\">Выберите пункт меню слева</h1>\\n\"}}','2018-05-22 09:57:16'),(5,NULL,64,'{\"content\":{\"value\":\"<style>\\n    .cards__img-wrapp {\\n        max-height:400px;\\n        height:400px;\\n    }\\n    \\n    @media (min-width: 992px) and (max-width: 1366px) {\\n        .cards__img-wrapp {\\n            max-height:450px;\\n            height:450px;\\n        }\\n    }\\n    \\n    @media (min-width: 425px) and (max-width: 991px) {\\n        .cards__img-wrapp {\\n            max-height:500px;\\n            height:500px;\\n        }\\n    }\\n</style>\"}}','2018-08-21 16:36:23'),(6,NULL,65,'{\"content\":{\"value\":\"<h1 class=\\\"text-center\\\">test of fragment move</h1>\",\"body\":\"<p><span style=\\\"font-size:16px;\\\"><span style=\\\"font-family:Verdana,Geneva,sans-serif;\\\">Похоронный агент &ndash; это человек, который занимается организацией похорон под ключ. Здесь Вы можете ознакомиться со списком ритуальных агентов, работающих в МП КПРУ. </span></span></p>\\n\\n<p><span style=\\\"font-size:16px;\\\"><span style=\\\"font-family:Verdana,Geneva,sans-serif;\\\">Чтобы совершить <strong>вызов похоронного агента</strong>, в</span></span><span style=\\\"font-size:16px;\\\"><span style=\\\"font-family:Verdana,Geneva,sans-serif;\\\">ведите Ваш номер в строку ниже, чтобы заказать обратный звонок от агента&nbsp;или выберите понравившегося Вам ритуального агента из списка.</span></span></p>\\n\"}}','2018-08-21 16:37:17'),(9,NULL,79,'{\"content\":{\"body\":\"<p><img alt=\\\"\\\" src=\\\"/uploads/upload_85c04bdc55050de6116c2ca47ba3f99c.jpg\\\" style=\\\"width: 400px; height: 309px;\\\" /></p>\\n\"}}','2018-08-24 02:40:49'),(10,NULL,81,'{\"content\":{\"content\":\"С 18.09.2018 до 25.09.2018\"}}','2018-08-24 11:42:33'),(11,NULL,82,'{\"content\":{\"content\":\"123\"}}','2018-08-24 11:45:55'),(16,NULL,97,'{\"content\":{\"slides\":[{\"id\":1,\"img\":\"\",\"img_bottom\":\"\",\"title\":\"\",\"title_bottom\":\"\",\"description\":\"\",\"href\":\"\"},{\"id\":2,\"img\":\"\",\"img_bottom\":\"\",\"title\":\"\",\"title_bottom\":\"\",\"description\":\"\",\"href\":\"\"},{\"id\":3,\"img\":\"\",\"img_bottom\":\"\",\"title\":\"\",\"title_bottom\":\"\",\"description\":\"\",\"href\":\"\"},{\"id\":4,\"img\":\"\",\"img_bottom\":\"\",\"title\":\"\",\"title_bottom\":\"\",\"description\":\"\",\"href\":\"\"}],\"lastId\":4}}','2018-08-27 05:46:04'),(17,NULL,100,'{\"content\":{\"body\":\"<p style=\\\"text-align: center;\\\"><span style=\\\"font-size:36px;\\\">Есть новости?</span></p>\\n\\n<p style=\\\"text-align: center;\\\">Предложите свою новость для публикации, используя форму ниже</p>\\n\"}}','2018-08-27 06:24:14'),(19,NULL,115,'{\"content\":{\"body\":\"<h1 style=\\\"text-align: center;\\\">&nbsp;</h1>\\n\\n<h1 style=\\\"text-align: center;\\\">Добро пожаловать</h1>\\n\",\"content\":\"Добро пожаловать на главную страницу\",\"value\":\"<div class=\\\"text-center\\\" style=\\\"padding-top:30px;\\\">\\n    <h1>Добро пожаловать</h1>\\n    <h2>Приветствуем Вас на универсальной платформе для создания сайтов</h2>    \\n</div>\\n\"}}','2018-09-18 10:17:13'),(20,NULL,115,'{\"content\":{\"body\":\"<h1 style=\\\"text-align: center;\\\">&nbsp;</h1>\\n\\n<h1 style=\\\"text-align: center;\\\">Добро пожаловать</h1>\\n\",\"content\":\"Добро пожаловать на главную страницу\",\"value\":\"<div class=\\\"text-center\\\" style=\\\"padding-top:30px;\\\">\\n    <h1>Добро пожаловать</h1>\\n    <h2>Приветствуем Вас на универсальной платформе для создания сайтов</h2>    \\n</div>\\n\"}}','2018-09-18 10:17:13'),(21,NULL,116,'{\"content\":{\"body\":\"<h1>&nbsp;</h1>\\n\\n<p>&nbsp;</p>\\n\\n<p>&nbsp;</p>\\n\\n<h2 style=\\\"text-align: center;\\\">Блок статического контента</h2>\\n\\n<p>&nbsp;</p>\\n\\n<p>С помощью блока статического контента можно писать простой текст, заголовки, таблицы, колонки и многое другое.<span style=\\\"display: none;\\\">&nbsp;</span></p>\\n\\n<p>&nbsp;</p>\\n\\n<table border=\\\"0\\\" cellpadding=\\\"1\\\" cellspacing=\\\"1\\\" style=\\\"width:90%;margin:0 auto;\\\">\\n\\t<thead>\\n\\t\\t<tr>\\n\\t\\t\\t<th width=\\\"50%\\\">Левая колонка</th>\\n\\t\\t\\t<th>Правая колонка</th>\\n\\t\\t</tr>\\n\\t\\t<tr>\\n\\t\\t\\t<td>Блок статического контента позволяет вставлять в определенные места страниц произвольный контент, который может редактироваться на ходу в легком встроенном текстовом редакторе, имеющем доступ к HTML-коду редактируемого содержимого</td>\\n\\t\\t\\t<td>Имея в распоряжении блок статического контента уже можно создавать простые сайты, содержащие статическую текстовую информацию и картинки.</td>\\n\\t\\t</tr>\\n\\t</thead>\\n\\t<tbody>\\n\\t</tbody>\\n</table>\\n\\n<p>&nbsp;</p>\\n\\n<p>Расширенные возможности блока позволяют встраивать в него видео и фреймы, содержащие контент с других сайтов.</p>\\n\\n<p>&nbsp;</p>\\n\\n<p>&nbsp;</p>\\n\\n<p>&nbsp;</p>\\n\"}}','2018-09-18 10:33:05'),(22,NULL,117,'{\"content\":{\"value\":\"<div style=\\\"width:100%; background: #777; padding: 30px 0; color: #fff;\\\">\\n    <div style=\\\"width:90%; margin:20px auto;\\\">\\n        <h2>Блок исходного кода</h2>\\n        <p>Блок исходного кода позволяет использовать на странице чистый HTML-код, и редактировать его с помощью удобного встроенного редактора исходного кода</p>\\n        <br />\\n        <img src=\\\"/img/components/source-code/source-code.jpg\\\" style=\\\"display:block; margin: 0 auto;\\\" />\\n    </div>\\n</div>\"}}','2018-09-18 10:47:47'),(24,NULL,127,'{\"content\":{\"body\":\"<p>&nbsp;</p>\\n\\n<p>На этой странице пользователи Вашего сайта смогут оставлять сообщения для Вас, по интересующим их вопросам. Эти сообщения можно просмотреть в разделе администрирования обратной связи, также возможно настроить их дублирование на почту.</p>\\n\\n<p>&nbsp;</p>\\n\\n<p>Данный компонент позволяет создавать множество форм обратной связи в пределах одного проекта, для чего и служит поле категории обратной связи. Дополнительно можно включать и отключать те или иные&nbsp;поля, которые должен заполнять пользователь, и запрещать писать сообщения незарегистрированным пользователям.</p>\\n\\n<p>&nbsp;</p>\\n\\n<p>В перспективе планируется перенести администрирование в сам компонент, запретить редактирование своих данных зарегистрированным пользователям, и&nbsp;добавить возможность разрешать редактирование этих данных на отдельных фрагментах.</p>\\n\\n<h3 style=\\\"text-align: center;\\\">Форма обратной связи</h3>\\n\"}}','2018-09-19 07:55:28'),(25,NULL,128,'{\"content\":{\"body\":\"<p>Здесь Вы сможете публиковать вакансии Вашей компании и собирать отклики от соискателей. В данный момент компонент работает только в текстовом режиме, но в перспективе планируется его доработка, а именно добавление возможности&nbsp;смены приоритета вакансий в списке, поиск по вакансиям и отключаемая возможность деления по группам и отделам.</p>\\n\\n<p>Что касается страницы вакансии, то там планируется&nbsp;разбиение описание на отдельные поля (требования, условия и т.д.) с возможностью отключения отдельных полей, добавление фото к вакансии, заморозка вакансии (в данный момент набора на данную вакансию нет, но мы готовы рассмотреть Вас, как только он начнётся), расширение функционала для ответа на вакансию (электронное резюме, с возможностью прикреплять файлы).</p>\\n\"}}','2018-09-19 08:20:46'),(26,NULL,129,'{\"content\":{\"body\":\"<h3 style=\\\"text-align: center;\\\">&nbsp;</h3>\\n\\n<h3 style=\\\"text-align: center;\\\">&nbsp;</h3>\\n\\n<h3 style=\\\"text-align: center;\\\">Список вакансий</h3>\\n\"}}','2018-09-19 08:30:55'),(27,NULL,129,'{\"content\":{\"body\":\"<h3 style=\\\"text-align: center;\\\">&nbsp;</h3>\\n\\n<h3 style=\\\"text-align: center;\\\">&nbsp;</h3>\\n\\n<h3 style=\\\"text-align: center;\\\">Список вакансий</h3>\\n\"}}','2018-09-19 08:30:55'),(29,NULL,137,'{\"content\":{\"body\":\"<p>На этой странице будут размещены примеры шаблонов, используемых в движке. Каждый маршрут этого раздела содержит только шаблон страницы, на котором ещё не было каких-либо действий, добавлений и т.п., за исключением двух- и трехколоночных шаблонов, в которых уже добавлен компонент общей навигации, чтобы с них можно было переходить не только через кнопку возврата.</p>\\n\\n<p>Также в трехколоночный макет и на эту самую страницу&nbsp;добавлен список объявлений, т.к правая колонка делается именно под него.</p>\\n\"}}','2018-09-20 09:47:20'),(30,NULL,150,'{\"content\":{\"body\":\"<p>&nbsp;</p>\\n\\n<p>В этом разделе будут рамещены страницы для компонентов, из которых далее будет составляться модуль для кладбищенских сайтов, таких как, например, поиск захоронений, книга памяти, вызов ритуального агента и многие другие.</p>\\n\"}}','2018-09-20 17:52:11');
