INSERT INTO `shops_list` VALUES (1,NULL,'В новых','1','<p>Магазин имеет удобное расположение среди новостроек. В нем всегда в наличии весть ассортимент нашей продукции</p>','Новая 7','+7 (3519) 99-88-77','{\"1\":[\"08:00\",\"17:00\"],\"2\":[\"09:00\",\"17:00\"],\"3\":[\"09:00\",\"17:00\"],\"4\":[\"09:00\",\"17:00\"],\"5\":[\"09:00\",\"17:00\"],\"6\":[\"09:00\",\"17:00\"],\"7\":[\"09:00\",\"17:00\"]}','53.379642208383935, 58.98146580546363','2018-06-08 11:21:45'),(2,NULL,'В Ленинском','2','<p>Удачное расположение этого магазина сделает его посещение действительно простым и удобным, а широкий ассортимент продукции в наличии позволит не ждать доставки заказа.</p>','Ленина 10','+7 (3519) 33-44-55','{\"1\":[\"08:00\",\"17:00\"],\"2\":[\"09:00\",\"17:00\"],\"3\":[\"09:00\",\"17:00\"],\"4\":[\"09:00\",\"17:00\"],\"5\":[\"09:00\",\"17:00\"],\"6\":[\"09:00\",\"17:00\"],\"7\":[\"09:00\",\"17:00\"]}','53.436814, 58.971331','2018-06-08 11:21:49'),(3,NULL,'На левом','4','<p>Мы специально открыли магазин на левом берегу нашего города, чтобы Вам не приходилось ездить слишком далеко за покупками в магазины нашей компании.</p>','Левая 77','+7 (3519) 88-77-66','{\"1\":[\"08:00\",\"17:00\"],\"2\":[\"09:00\",\"17:00\"],\"3\":[\"09:00\",\"17:00\"],\"4\":[\"09:00\",\"17:00\"],\"5\":[\"09:00\",\"17:00\"],\"6\":[\"09:00\",\"17:00\"],\"7\":[\"09:00\",\"17:00\"]}','53.383805, 59.102614','2018-06-08 11:21:51');
