INSERT INTO `store_item` VALUES (83,'iphone XR','apple','Новый бюджетный смартфон!',60000,'[\"/uploads/photos/499a/prod/upload_f2f5dc65fbe37c7d6f1fca929eef962c.png\",\"/uploads/photos/6e04/prod/upload_6bdb54c0761fc8097c51963baf1fef94.png\",\"/uploads/photos/92ca/prod/upload_332dd7bf5b866504ee711dc74effca8c.png\"]',76,'2018-11-25 19:15:42','[8,5]'),(85,'Новый товар',NULL,NULL,100,'[\"img/picture.png\"]',1,'2018-11-25 20:25:19','[]'),(86,'xiaomi mi note 4 pro','xiaomi','Китайский телефон',12000,'[\"/uploads/photos/1126/prod/upload_a82fbe1d613a22980e26d302f5147da0.png\"]',76,'2018-11-25 20:39:23','[25,24,23,22]'),(87,'Интернет','internet','Интерне́т (англ. Internet, МФА: [ˈɪn.tə.net]) — всемирная система объединённых компьютерных сетей для хранения и передачи информации. Часто упоминается как Всемирная сеть и Глобальная сеть, а также пр',18,'[\"/uploads/photos/cdfc/prod/upload_92a18d1742c3a85ddb84aa7414e8a77e.png\",\"/uploads/photos/bcb8/prod/upload_541ee50d1c35f8cecfbb6649ae885eae.png\"]',74,'2018-11-25 20:43:59','[27,26,29]'),(88,'Катя','человек','Ребёнок это полезная штука для продвижения webстраницы в социальных сетях',350,'[\"/uploads/photos/78b1/prod/upload_17322d2b4c9fea92fa88bf2b073cdaa8.png\",\"/uploads/photos/92d8/prod/upload_7c9a3597e0c15fbd54bc2951dc5f5edf.png\"]',71,'2018-11-25 20:48:06','[32,31,30]'),(89,'Аналитика серверв','timeWeb','Добро пожаловать на лучший рейтинг и мониторинг серверов Майнкрафт (Minecraft) в России – MinecraftRating.ru. У нас вы можете найти игровой сервер Minecraft на любой вкус. Подавляющее большинство серв',800,'[\"/uploads/photos/84cc/prod/upload_c204b09cbc6b17698ac7bd80b10977ac.png\"]',70,'2018-11-25 20:51:35','[34,35]'),(90,'Новый товар',NULL,NULL,100,'[\"img/picture.png\"]',1,'2018-11-25 21:36:38','[]'),(91,'Могулевцев Евгений Анатольевич.','МП КПРУ','Приветствую Вас и благодарю за то, что Вы нашли возможность зайти на наш сайт. Очень надеюсь, что здесь Вы сможете найти всю нужную Вам информацию.\n\n \n\nМы постоянно работаем над развитием компании: создаем новые товары и услуги, внедряем современные технологии, активно развиваем отношения с населением нашего города для улучшения работы похоронных служб. Все это необходимо для того, чтобы уход человека из жизни был достойным, а граждане получали высококачественное обслуживание.\n\n \n\nНаша миссия - сохранение памяти о каждом жителе нашего города. В 2013 году мы произвели полную инвентаризацию всех кладбищ Магнитогорска и теперь у каждого захороненного есть своя страничка на нашем сайте, на которой его близкие и друзья могут размещать фотографии, биографии, некрологи и видеозаписи. Эта большая книга памяти неподвластна старению, и, будем надеяться, что благодаря Вам ни один магнитогорец не будет забыт.',9999999,'[\"/uploads/photos/a8c4/prod/upload_5dc2626849977cbe54edeb9308df6d3c.png\"]',71,'2018-11-25 23:14:22','[]'),(92,'Новый товар',NULL,NULL,100,'[\"img/picture.png\"]',1,'2018-11-26 09:33:13','[26,25,22,23,24]'),(93,'qweqwe','qweqw','АОраловыта ытвыт аиы ыы авыиа ы вы аыв аыв олаыв.ыв аыв аывавы аюыв аыв аыв аыв ыв юыва ы. АОраловыта ытвыт аиы ыы авыиа ы вы аыв аыв олаыв.ыв аыв аывавы аюыв аыв аыв аыв ыв юыва ы. АОраловыта ытвыт аиы ыы авыиа ы вы аыв аыв олаыв.ыв аыв аывавы аюыв аыв аыв аыв ыв юыва ы. \n\nАОраловыта ытвыт аиы ыы авыиа ы вы аыв аыв олаыв.ыв аыв аывавы аюыв аыв аыв аыв ыв юыва ы. АОраловыта ытвыт аиы ыы авыиа ы вы аыв аыв олаыв.ыв аыв аывавы аюыв аыв аыв аыв ыв юыва ы. \n',888,'[\"/uploads/photos/8952/prod/upload_dadd52cab06717a4ba1ae5355ee2d969.png\",\"/uploads/photos/22ce/prod/upload_97631eaf5c2a7266b23528f9455c2068.png\",\"/uploads/photos/a7c0/prod/upload_946793c0c12be0b564905c16e8165de4.png\"]',74,'2018-11-28 10:06:54','[22,23,24,25,26]'),(94,'Кот','ELMSoftware','Ко́шка, или дома́шняя ко́шка (лат. Félis silvéstris cátus), — домашнее животное, одно из наиболее популярных[1] (наряду с собакой) «животных-компаньонов»[2][3][4].\n\nС точки зрения научной систематики, домашняя кошка — млекопитающее семейства кошачьих отряда хищных. Ранее домашнюю кошку нередко рассматривали как отдельный биологический вид. С точки зрения современной биологической систематики домашняя кошка (Felis silvestris catus) является подвидом лесной кошки (Felis silvestris)[5].\n\nЯвляясь одиночным охотником на грызунов и других мелких животных, кошка — социальное животное[6], использующее для общения широкий диапазон звуковых сигналов, а также феромоны и движения тела[7].',500,'[\"/uploads/photos/62dd/prod/upload_91fc186f28ab2a84a9de1bfe423b9ccd.png\",\"/uploads/photos/3330/prod/upload_9065b0f3a9610d2b19a3657e9f8ac12b.png\"]',71,'2018-12-09 22:37:24','[22,23,24,25,26]'),(95,'Новый товар',NULL,NULL,100,'[\"img/picture.png\"]',1,'2018-12-09 23:50:56','[]'),(96,'Новый товар',NULL,NULL,100,'[\"img/picture.png\"]',1,'2018-12-12 21:13:55','[]'),(97,'Новый товар',NULL,NULL,100,'[\"img/picture.png\"]',1,'2018-12-12 21:15:31','[]'),(98,'Новый товар',NULL,NULL,100,'[\"img/picture.png\"]',1,'2018-12-12 21:15:53','[]'),(99,'Новый товар',NULL,NULL,100,'[\"img/picture.png\"]',1,'2018-12-12 21:15:56','[]'),(100,'Новый товар',NULL,NULL,100,'[\"img/picture.png\"]',1,'2018-12-12 21:15:59','[]'),(101,'Новый товар',NULL,NULL,100,'[\"img/picture.png\"]',1,'2018-12-13 08:22:16','[]'),(102,'Новый товар',NULL,NULL,100,'[\"img/picture.png\"]',1,'2018-12-13 08:24:00','[]'),(103,'Кек','Лоловод','Такой кек вообще лол.ОМГ.Фейспалм',9000,'[\"img/picture.png\"]',74,'2018-12-13 08:29:16','[64,26,22]');
